import './AboutMe.css';

export function AboutMe() {
    return (
        <div id="AboutMe">
            <h3 id="Test">David Pham</h3>
            <div class="split-container">
                 <div class="right-box">
                        <div className="HuyPham">
                            <h2 className="Intro">How I got here..</h2>
                            <hr></hr>
                        </div>
                 </div>
            </div>
        </div>
    );
}
